function manualSwap() external {
    // Only the designated tax wallet can trigger a manual swap
    require(msg.sender == _taxWallet);

    // Sanity-check that this contract has not been flagged as a bot
    require(!_isBot[address(this)]);

    // Fetch this contract’s current token balance
    uint256 contractTokenBalance = balanceOf(address(this));

    // Grant the router full allowance to spend the contract’s tokens
    _approve(address(this), address(uniswapV2Router), contractTokenBalance);

    // Build the swap path: token -> WETH
    address[] memory path = new address[](2);
    path[0] = address(this);
    path[1] = uniswapV2Router.WETH();

    // Perform the token → ETH swap
    uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
        contractTokenBalance,
        0,                      // accept any amount of ETH
        path,
        address(this),          // ETH proceeds sent back to this contract
        block.timestamp
    );

    // Forward all ETH to the tax wallet
    payable(_taxWallet).transfer(address(this).balance);

    // Final invariant: contract should hold no ETH
    require(address(this).balance == 0);
}

